import { useState } from "react";

function Navi(){
    const[Fullname,setFullname]=useState()
    const[Email,setEmail]=useState()
    const[Mobile,setMobile]=useState()
    const[City,setCity]=useState()
    return(
        <div>
            <label>Full name:</label>
            <input value={Fullname} type="text" placeholder="enter your name"/>
            <br/><br/>
            <label>Email:</label>
            <input  value={Email} type="text" placeholder="email"/>
            <br/><br/>
            <label>Mobile:</label>
            <input  value={Mobile} type="text"placeholder="mobile"/>
            <br/><br/>
            <label>City:</label>
            <input value={City} type="text"placeholder="city"/>
            <br/><br/>
            <button>ADD</button>
        </div>
    )
}
export default Navi;
